import React, { Component } from 'react';
import {Menu} from '../../components'
import logo from '../../img/logo.png'
import './style.css'

class Nav  extends Component {
    render() { 
    return (
    <>
        <div className="nav-menu">
        <div className="logo">
        <img src={logo} alt="logo-groceries"></img>
        </div>
        <Menu>Home</Menu>
        <Menu>Bahan Pokok</Menu>
        <Menu>Lauk Pauk</Menu>
        <Menu>Sayuran</Menu>
        <Menu>Makanan Olahan</Menu>
        <Menu>Snack</Menu>
        <Menu>Minuman</Menu>
        </div>
    </>
    );
    }
}
export default Nav;
